import React from 'react';

const Header = () => {
  return (
    <header style={headerStyle}>
      <h1>Annotation Tool</h1>
      <nav>
        <a href="/">POS</a> | <a href="/about">Named entity</a> | <a href="/contact">Sentimental</a>
      </nav>
    </header>
  );
};

const headerStyle = {
  background: '#333',
  color: '#fff',
  textAlign: 'center',
  padding: '10px 0'
};

export default Header;
